    false,nt"url": null,nt"notes": "Brandy Pond is a remote, shallow, pond
    in eastu2010central Maine. A bald eagle (Haliaeetus leucocephalus) nest territory
    has existed on the pond since the mid-1960s. Since the establishment of the nest,
    the bald eagle territory at Brandy Pond has had extremely poor productivity. Researchers
    have collected ten nonu2010viable eagle eggs at the pond over the past five decades
    and mercury levels in eggs have chronically been well above suggested reproductive
    effect thresholds. The source of mercury contamination in the Brandy Pond watershed
    is not known. To resolve the issue, sediments and fish were collected from Brandy
    Pond and from Eagle Lake, a nearby reference lake, and analyzed for mercury. Sediments
    were also collected from Buffalo Stream, above and below the location of a former
    tannery.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
